import { Route, Routes } from "react-router-dom";
import React, { Suspense } from "react";
import HelloWorld from "../../Pages/HelloWorld/HelloWorld";
import Layout from "../../components/organisms/Layout";
const Log = () => {
  return (
    <>
      <Routes>
        <Route
          exact
          element={
            <Layout/>
          }
          childreN
        />
        
      </Routes>
    </>
  );
};
export default Log;
